import React, { Component } from "react";
import { View, Text, StyleSheet, Style, TouchableOpacity, ImageBackground, Image } from "react-native";
import { ScrollView, TextInput } from "react-native-gesture-handler";
import { TextInputMask } from 'react-native-masked-text'
import { max } from "react-native-reanimated";


export default class cadastroUser extends Component{
    constructor(props)
    {
        super(props);
        this.state =
        {
            cnpj: '',
            CEP: '',
        }
    }

    render()
    {
        return(
            <View style={styles.container}>

                <View style={styles.ctnH1}>
                    <TouchableOpacity style={styles.TouchH1}>
                        <Image style={styles.imgH1} source={require('../../../assets/Arrow.svg')}/>
                    </TouchableOpacity>
                <Text style={styles.txtH1}>Formul√°rio</Text>
                </View>
            
                <View style={styles.ctnText}>
                    <TouchableOpacity>
                        <Text style={styles.txtBtn}>Ler os termos de contrato</Text>
                    </TouchableOpacity>
                </View>
            </View>
        )
    }

}

const styles = StyleSheet.create({
    container: {
        flex: 1,
    
      },
    
      imgH1: {
        width: '50%',
        height: '100%',
      },
    
      ctnH1: {
        flex: 0.3,
        backgroundColor: '#00873B',
    
        alignItems: 'center',
        flexDirection: 'row',
      },
      
      TouchH1: {
        width: '20%',
        height: '10%',
        // backgroundColor : 'blue',
    
        justifyContent: 'center',
        alignItems: 'center',
      },
    
      txtH1: {
        fontSize: 25,
        fontWeight: 'bold',
        color: 'white',
      },

      ctnText: {
        flex: 0.05,
        marginTop: 10,
        backgroundColor: 'green',
        
        justifyContent: 'center',
        alignItems: 'center',
      },

      txtBtn: {
        fontSize: 25,
        fontFamily: 'Arial',
        textDecorationLine: 'underline'
      },

})
